import * as React from "react";
import { Routes, Route, Link } from "react-router-dom";
import "./App.css";
import MainPage from "./MainPage";

function App() {
  return (
    <div className="App">
      <h1>Welcome to React Router!</h1>
      <Routes>
        <Route path="/" element={<MainPage />} />
        {/* <Route path="about" element={<About />} /> */}
      </Routes>
    </div>
  );
}
export default App;
